import React from 'react';
import './ResultPage.css';

function ResultPage() {
  const handleExit = () => {
    alert('退出功能');
  };

  const handleReport = () => {
    alert('考试报告功能');
  };

  return (
    <div className="result-page">
      <div className="result-header">
        <h1>上机编程认证科目-iLearning（入门级，Java）</h1>
        <button className="exit-btn" onClick={handleExit}>退出</button>
      </div>

      <div className="result-content">
        <div className="student-info">考生：王宇庭 00937128</div>

        <h2 className="section-title">考试结果</h2>

        <div className="result-main">
          <div className="illustration-container">
            <svg width="400" height="350" viewBox="0 0 400 350" fill="none" xmlns="http://www.w3.org/2000/svg">
              {/* 背景装饰方块 */}
              <rect x="50" y="80" width="200" height="240" rx="15" fill="#E8E8F8" opacity="0.6"/>

              {/* 纸张 */}
              <rect x="280" y="100" width="80" height="180" rx="5" fill="#FFD93D" transform="rotate(15 320 190)"/>
              <line x1="290" y1="120" x2="340" y2="125" stroke="#FFA500" strokeWidth="3" transform="rotate(15 315 122)"/>
              <line x1="285" y1="140" x2="345" y2="145" stroke="#FFA500" strokeWidth="3" transform="rotate(15 315 142)"/>

              {/* 人物鞋子 */}
              <ellipse cx="130" cy="300" rx="25" ry="12" fill="#888888"/>
              <ellipse cx="180" cy="300" rx="25" ry="12" fill="#888888"/>

              {/* 裤子 */}
              <path d="M 120 220 L 110 300 L 140 300 L 145 220 Z" fill="#3D5A98"/>
              <path d="M 165 220 L 170 300 L 200 300 L 190 220 Z" fill="#3D5A98"/>

              {/* 身体 */}
              <rect x="115" y="150" width="80" height="80" rx="10" fill="#5B8FDB"/>

              {/* 衣领 */}
              <path d="M 135 150 L 145 165 L 155 150 Z" fill="#FFFFFF"/>
              <path d="M 165 150 L 155 165 L 175 150 Z" fill="#FFFFFF"/>

              {/* 左手臂 */}
              <ellipse cx="95" cy="180" rx="18" ry="50" fill="#5B8FDB" transform="rotate(-20 95 180)"/>
              <ellipse cx="75" cy="215" rx="15" ry="18" fill="#FFB6B6"/>

              {/* 右手臂 */}
              <ellipse cx="215" cy="180" rx="18" ry="50" fill="#5B8FDB" transform="rotate(35 215 180)"/>
              <ellipse cx="245" cy="200" rx="15" ry="18" fill="#FFB6B6" transform="rotate(20 245 200)"/>

              {/* 头部 */}
              <circle cx="155" cy="120" r="35" fill="#FFB6B6"/>

              {/* 头发 */}
              <path d="M 130 105 Q 155 85 180 105 Q 185 95 180 110 Q 180 120 175 125 L 135 125 Q 130 120 130 110 Q 125 95 130 105 Z" fill="#4A5568"/>

              {/* 刘海 */}
              <path d="M 135 110 Q 145 100 155 110" fill="#4A5568"/>
              <path d="M 155 110 Q 165 100 175 110" fill="#4A5568"/>

              {/* 眼睛 */}
              <ellipse cx="145" cy="120" rx="3" ry="4" fill="#333333"/>
              <ellipse cx="165" cy="120" rx="3" ry="4" fill="#333333"/>

              {/* 微笑 */}
              <path d="M 145 132 Q 155 137 165 132" stroke="#333333" strokeWidth="2" fill="none" strokeLinecap="round"/>

              {/* 装饰纸片 */}
              <path d="M 60 180 L 100 160 L 110 180 L 70 200 Z" fill="#FFE5B4" opacity="0.8"/>
              <path d="M 300 250 L 320 260 L 315 280 L 295 270 Z" fill="#FFE5B4" opacity="0.8"/>
            </svg>
          </div>

          <div className="result-info">
            <div className="fail-stamp">
              <div className="stamp-circle">
                <span className="fail-text">Fail</span>
              </div>
            </div>

            <h3 className="result-title">未通过，继续努力吧~</h3>

            <div className="details">
              <div className="detail-item">
                <span className="label">是否通过：</span>
                <span className="value fail">未通过</span>
              </div>

              <div className="detail-item">
                <span className="label">编程题数：</span>
                <span className="value">2</span>
              </div>

              <div className="detail-item">
                <span className="label">考试用时：</span>
                <span className="value">43分钟 / 125分钟</span>
              </div>
            </div>

            <button className="report-btn" onClick={handleReport}>
              考试报告
            </button>
          </div>
        </div>

        <div className="encouragement">
          别灰心呦，失败乃成功之母，再考一次就过啦！
        </div>
      </div>

      {/* 水印背景 */}
      <div className="watermark">王宇庭 00937128</div>
    </div>
  );
}

export default ResultPage;
